import classes from "./AvailableMeals.module.css";

const AvailableMeals = (props) => {
  return (
    <div className={classes.meals}>
      <u>{props.meals.id}</u>
      <u>{props.meals.name}</u>
      <u>{props.meals.description}</u>
      <u>{props.meals.price}</u>
    </div>
  );
};

export default AvailableMeals;
